import { Header, Text } from "@mantine/core";

export default function Navbar() {
  return (
    <Header height={60} p="xs">
      <Text
        component="span"
        align="center"
        variant="gradient"
        gradient={{ from: "indigo", to: "cyan", deg: 45 }}
        size="xl"
        weight={700}
        style={{ fontFamily: "Greycliff CF, sans-serif" }}
      >
        Toggy Smith
      </Text>
    </Header>
  );
}
